import React from 'react';


const card = () => {
    return (
        <div>
            <img alt="robot" src="https://robohash.org/test?size=200x200?set=set4"/>
            <div>
                <h2>Jane Doe</h2>
                <p>janedoe@email.com</p>
            </div>
        </div>
    )
}







export default card;
